 - útgáfustofnun ISO/IEC 15459 kóða;
 - leyfis eða samnings númer sem samræmist forskriftum viðkomandi útgáfustofnunar;
 og það:
 - inniheldur aðeins hástafi og/eða tölustafi;
 - er einstakt (það er, er frábrugðið öðrum ISO/IEC 15459 samrýmanlegum auðkenni) innan sviðs útgáfustofnunarinnar;
 - getur ekki verið leitt af öðru ISO/IEC 15459 samrýmanlegu auðkenni, gefið út undir sömu útgáfustofnun, með því að bæta við stöfum við enda þess, eða fjarlægja þá frá því.

