'26L' Staðsetningarkóði, vera kóði sem auðkennir staðsetningu eða landfræðilegt svæði, eða tengdan hóp slíkra staðsetninga eða svæða, sem hefur þýðingu fyrir tengdan viðskipti og sem samræmist einni af strúktúrunum skilgreindum í (a) til (f) hér að neðan:
a) tveir hástafir sem samsvarar ISO 3166-1 tveggja stafa landskóða landsins þar sem staðsetning(ar) eða svæði eru staðsett;
b) þrír hástafir sem samsvarar IATA kóða flugvallar eða borgar í, nálægt, eða samanstendur af staðsetningunni (svæðinu);
c) fjórir eða fleiri stafir þar sem fyrstu þrír samsvara ISO 3166-1 landskóða fylgt af bandstriki (-), með því sem eftir er vera póstnúmer í viðkomandi landi;
d) fjórir eða fleiri stafir þar sem fyrstu þrír samsvara ISO 3166-1 landskóða fylgt af punkti (.), með því sem eftir er vera ISO 3166-2 landsundirkóði í viðkomandi landi;
e) fimm hástafir sem samsvarar UN/LOCODE svæðisins í, nálægt, eða samanstendur af staðsetningunni (svæðinu);
f) samsetning, vera ekki minna en sjö eða fleiri en 35 stafir að lengd, af:
- útgáfustofnunarkóða ISO/IEC 15459;
- staðsetningarkóða, sem samanstendur af stöfum dregnum úr settinu {A-Z; 0-9} sem samræmist forskriftum viðkomandi útgáfustofnunar.

