 - útgáfustofnunarkóða ISO/IEC 15459;
 - búnaðarnúmer sem samræmist forskriftum viðkomandi útgáfustofnunar; og að:
 - inniheldur aðeins hástafi í stafrófi og/eða tölustafi;
 - er einstakt (það er, er frábrugðið öðrum ISO/IEC 15459 samrýmanlegu auðkenni) innan sviðs útgáfustofnunarinnar;
 - getur ekki komið frá öðru ISO/IEC 15459 samrýmanlegu auðkenni, gefið út undir sömu útgáfustofnun, með einfaldri viðbót stafa við, eða þeirra fjarlægingu frá, því enda.
