Búnaðarauðkenni, vera alheims einstakt auðkenni fyrir tæki, búnað eða tilvik af tölvuforriti notað í framleiðslu, flutningi, vinnslu eða annarri meðhöndlun á hlutum.

UPU Staðsetningarkóði, vera kóði sem auðkennir staðsetningu eða landfræðilegt svæði, eða tengdan hóp slíkra staðsetninga eða svæða, sem hefur þýðingu fyrir viðkomandi viðskipti og sem samræmist einu af þeim uppbyggingum sem skilgreindar eru í a) til g) hér að neðan:
a) tveir hástafir samkvæmt ISO 3166-1 tveggja stafa landakóða þess lands sem staðsetning(ar) eða svæði(s) eru staðsett í eða samanstendur af;
b) þrír hástafir samkvæmt IATA kóða flugvallar eða borgar í, nálægt eða samanstendur af þeirri staðsetningu(r) eða svæði(s) sem um ræðir;
c) fjórir eða fleiri stafir þar sem fyrstu þrír samræmast ISO 3166-1 landakóða fylgt af bandstriki (-), með afganginum sem póstnúmer í viðkomandi landi;
d) fjórir eða fleiri stafir þar sem fyrstu þrír samræmast ISO 3166-1 landakóða fylgt af punkti (.), með afganginum sem ISO 3166-2 landsundirkóði í viðkomandi landi;
e) fimm hástafir samkvæmt UN/LOCODE svæðisins í, nálægt eða samanstendur af því, staðsetningu(r) eða svæði(s) sem um ræðir;
f) sex hástafir eða bókstafir samkvæmt UPU IMPC kóða úthlutað í samræmi við UPU staðal S34;
g) samsetning, vera ekki styttri en sjö né lengri en 25 stafir, af:
 - úthlutaður útgefandakóði í samræmi við UPU staðla S31;
 - staðsetningarkóði, samanstendur af stöfum dregnum úr settinu {A-Z; 0-9} sem samræmist tilgreiningum útgefandans.

Númeraplata með Þjónustugögnum og Staðsetningarkóða er samsett gagnabygging, í samræmi við tilgreiningu í UPU staðli S25, sem inniheldur tilgreiningu á:
 - auðkennara hlutar í samræmi við ISO/IEC 15459;
 - gögna auðkenni 5U samræmt tilgreiningu þjónustu sem veitt er í tengslum við hlutinn;
 - gögna auðkenni 17U samræmt UPU staðsetningarkóða eða gögna auðkenni 18U samræmt hæfan UPU staðsetningarkóða.
 Athugið - Nánari upplýsingar má finna í UPU staðli S25. Greinarmunur milli einfalds UPU staðsetningarkóða (DI 17U) og hæfs UPU staðsetningarkóða (DI 18U) má ákvarða frá fyrsta staf. Ef þetta er tölustafur, á 18U við; ef það er hástafur, á 17U við.

