Dagsetning, túlkuð í breyttu UTC samræmi formi:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo] þar sem hornklofar tákna valkvæði og yyyy er árið, mmdd mánuðurinn og dagurinn, hhmmss tími dags í klukkustundum mínútum og sekúndum, fff eru brot af sekúndum og poooo er frávik frá UTC tjáð í klukkustundum og mínútum, frávikið er jákvætt ef p er punktur (.), neikvætt ef P er mínusmerki (-).
DÆMI:
2005 - (UTC) almanaksár 2005;
200505 - (UTC) almanaksmánuður maí 2005;
20050518 - (UTC) 18. maí 2005;
200505181247 - 12:47 UTC á 18. maí 2005;
200505181247.0100 - 12:47 staðartími, sem er 11:47 UTC, á 18. maí 2005;
20050518124723099 - 99 millisekúndur eftir 12:47:23 UTC á 18. maí 2005.

Hæf Dagsetning, sem samanstendur af:
- útgáfustofnunarkóða ISO/IEC 15459;
- dagsetningarkvóta í samræmi við tilgreiningar þeirrar útgáfustofnunar;
- dagsetningu sem format og túlkun eru í samræmi við tilgreiningar þeirrar útgáfustofnunar fyrir þann dagsetningarkvóta.

Yfirlýsing um Pakkningarefni Flokk*, Kóða* og Þyngd fyrir tiltekið pakkningarefni notað í tiltekinni pökkun samkvæmt tilskipun ESB um pakkningar og pakkningaúrgang. (Efni flokkur og kóði skilgreindir í Viðauka M).
12ECCMMMMMMNNNNNUU þar sem: - '12E' (an3) er Gögn Auðkennari;
 - 'CC' (n2) er Efnisflokkur samkvæmt Viðauka M;
 - 'MMMMMM' (an1...6) er Efniskóði samkvæmt Viðauka M;
 - 'NNNNN' (n5) Efnaþyngd, með tugapunkti (t.d., 12.12);
 - 'UU' (an2) er Mælieining fyrir þyngd (t.d., KG, GR, LB eða OZ samkvæmt ANSI X12.3 eins og í Viðauka D).

