Viðtakendanúmer.
Einstakt auðkenninúmer getur verið IRS, EIN, SSN, eða CBP úthlutað númer, eins og krafist er á Öryggisskýrslu. Aðeins eftirfarandi snið skal nota: IRS EIN: NN-NNNNNNN;
IRS EIN með viðskeyti:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP úthlutað númer: YYDDPP-NNNNN.
